import React, { Component } from 'react';
import axios from 'axios';


class Home extends Component {
    constructor(props){
        super(props);
        this.state = {
            values: [],
            search: ""
        }
    }
    componentDidMount() {
        axios.get('http://localhost:5000/home/join')
        .then(res => {  this.setState({ values: [res.data] }); console.log(this.state) })
    }
    onchange = e => {
        this.setState({ search: e.target.value });
        console.log(this.state.search)
    };

    render() {

        return (
            <div>
                <h1>Home Component</h1>
                <input onChange={this.onchange} type="text"/>

            </div>
        );
    }
}

export default Home;
